    and contains gene expression data from whole larvae exposed to different concentrations
    of the pyrethroids across multiple experiments.nnThis dataset is associated with
    the following publication:nBiales, A., M. Kostich, A. Batt, M. See, R. Flick, D.
    Gordon, J. Lazorchak, and D. Bencic. Initial Development of a Multigene Omics-Based
